import React from 'react';
import './home.css';

export default function Home() {
    return (
        <div>
            <div className='home-header-div'>
                <h1 className='home-intro-header'>Hi I'm Logan, a Software Engineer, Data Engineer, and lifelong learner.</h1>
            </div>
            <div className='home-about-div'>
                <h2 className='home-about-header'>About Me</h2>
                <p>In my current role as a contingent worker for Meta, I serve as a Data Engineer and Data Scientist. From building ETL pipelines to implementing dynamic dashboards I assist prodops teams with building data driven decisions quickly.</p>

            </div>
        </div>
    )
}
